const PriestCard = ({ id, isCardVisible, setIsCardVisible }) => {
  const close = () => {
    setIsCardVisible(false);
  };
  return (
    <div>
      <div>PriestCard</div>
      <button onClick={close}>Close</button>
    </div>
  );
};

export default PriestCard;
